function FormularioHabilidades({ listaDeHabilidades }) {
  const ITEM_HEIGHT = 48;
  const ITEM_PADDING_TOP = 8;
  const MenuProps = {
    PaperProps: {
      style: {
        maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
        width: 250,
      },
    },
  };

  function listaa() {
    listaDeHabilidades.forEach((habilidade) => {
      console.log(habilidade);
    });
  }

  return <button onClick={listaa}>adsa</button>;
}

export default FormularioHabilidades;
